import { React, useState } from "react";
import { Col, Container, Row, Form } from "react-bootstrap";
import Button from "react-bootstrap/Button";

function Order() {
  const [name, setName] = useState("");
  const [price, setPrice] = useState("");
  const [qty, setQty] = useState("");
  const [discount, setDiscount] = useState("");
  const [total, setTotal] = useState("");
  const [paid, setPaid] = useState("");
  const [change, setChange] = useState("");
  const [test, setTest] = useState("123");

  const [inputs, setInputs] = useState("");
  const handleChange = (event) => {
    const name = event.target.name;
    const value = event.target.value;
    setInputs((values) => ({ ...values, [name]: value }));

    // if (name == "price" || name == "qty" || name == "discount") {
    //   let total = parseInt(inputs.price) * parseInt(inputs.qty);
    //   setTotal(total);
    // }

    console.log("handle change");
    // console.log(name);
    // console.log(value);
    // console.log(inputs.price);
    // console.log(inputs.qty);
  };

  const handleKeyup = (event) => {
      console.log("this is keyup");
      console.log(event.target.value);
      console.log(price);
      console.log(test);
  };

  const handleSubmit = (event) => {
    event.preventDefault();

    let jumlah = parseInt(inputs.price) * parseInt(inputs.qty);
    let gettotal = jumlah - (jumlah * (parseInt(inputs.discount) / 100));
    setTotal(gettotal);

    let kembalian = parseInt(inputs.paid) - gettotal;
    setChange(kembalian);

    // console.log("handle submit");
    // // console.log(kembalian);
    // console.log(parseInt(inputs.paid));
    // console.log(global.total.value);
  };

  return (
    <div className="my-5" style={{ paddingBottom: "80px" }}>
      <Row>
        <Col className="text-center">
          <h2>Order</h2>
          <p style={{ color: "#e39210", fontStyle: "italic" }}>
            Add your order here.
          </p>
        </Col>
      </Row>

<Container>
      <Row className="justify-content-center">
        <Col md={8} lg={8}>
          <Container className="py-5">
            <Form onSubmit={handleSubmit}>
              <Form.Group className="mb-3" controlId="nmbrng">
                <Form.Label>Nama Barang</Form.Label>
                <Form.Control
                  type="text"
                  name="name"
                  placeholder="Nama Barang"
                  onChange={handleChange}
                />
              </Form.Group>
              <Form.Group className="mb-3" controlId="harga">
                <Form.Label>Harga (Rp)</Form.Label>
                <Form.Control
                  type="number"
                  name="price"
                  placeholder="Rp."
                  onChange={handleChange}
                  onKeyUp={handleKeyup}
                />
              </Form.Group>
              <Form.Group className="mb-3" controlId="qty">
                <Form.Label>Qty</Form.Label>
                <Form.Control
                  type="number"
                  name="qty"
                  placeholder="Quantity"
                  onChange={handleChange}
                  onKeyUp={handleKeyup}
                />
              </Form.Group>
              <Form.Group className="mb-3" controlId="discount">
                <Form.Label>Discount (%)</Form.Label>
                <Form.Control
                  type="number"
                  name="discount"
                  placeholder="Discount"
                  onChange={handleChange}
                  onKeyUp={handleKeyup}
                />
              </Form.Group>
              <Form.Group className="mb-3" controlId="total">
                <Form.Label>Total (Rp)</Form.Label>
                <Form.Control
                  type="number"
                  name="total"
                  placeholder="Rp."
                  readOnly
                  value={total}
                  onChange={handleChange}
                />
              </Form.Group>

              <hr />

              <Form.Group className="mb-3" controlId="paid">
                <Form.Label>Bayar (Rp)</Form.Label>
                <Form.Control
                  type="number"
                  name="paid"
                  placeholder="Rp."
                  onChange={handleChange}
                />
              </Form.Group>
              <Form.Group className="mb-3" controlId="change">
                <Form.Label>Sisa/Kembalian (Rp)</Form.Label>
                <Form.Control
                  type="number"
                  name="change"
                  placeholder="Rp."
                  readOnly
                  onChange={handleChange}
                  value={change}

                />
              </Form.Group>

              <Button variant="success" type="submit">
                Pesan
              </Button>
            </Form>
          </Container>
        </Col>
        <Col md={4} lg={4}>
          hai
        </Col>
      </Row>
      </Container>
    </div>
  );
}

export default Order;
